script: |
  super -f text -I q5291.spq | sort > q5291.out

inputs:
  - name: q5291.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( + 28 + + - col1 ) IN ( col0 + - + col1 + + 81, ( + col1 ) * - - col0 * - 20 * + 97 - - - col1, col2, + + col0 );
  - name: tab1

outputs:
  - name: q5291.out
    data: |
      59
      68
      96
